      <div class="color-select-wrapper">
        <div class="box yellow" id="yellow" onclick="changeColor(id)"></div>
        <div class="box green" id="green" onclick="changeColor(id)"></div>
        <div class="box blue" id="blue" onclick="changeColor(id)"></div>
      </div>
    </div>
    <div
      class="modal fade"
      id="modal"
      tabindex="-1"
      aria-labelledby="exampleModalLabel"
      aria-hidden="true"
    >
      <div class="modal-dialog">
        <div class="modal-content">
          <div class="modal-header">
            <h5 class="modal-title" id="exampleModalLabel">Change Color</h5>
            <button
              type="button"
              class="btn-close"
              data-bs-dismiss="modal"
              aria-label="Close"
            ></button>
          </div>
          <div class="modal-body">
            <div class="box-wrapper">
              <div class="color yellow">
                <input
                  type="checkbox"
                  alt="booking"
                  name="check-color"
                  id="yellow"
                  onclick="onlyOne(this)"
                />
              </div>
              <p>Booking</p>
            </div>
            <div class="box-wrapper">
              <div class="color red">
                <input
                  type="checkbox"
                  alt="booked"
                  name="check-color"
                  id="red"
                  onclick="onlyOne(this)"
                />
              </div>
              <p>Booked</p>
            </div>
            <div class="box-wrapper">
              <div class="color green">
                <input
                  alt="available"
                  type="checkbox"
                  name="check-color"
                  id="green"
                  onclick="onlyOne(this)"
                />
              </div>
              <p>Available</p>
            </div>
          </div>
          <div class="modal-footer">
            <button
              type="button"
              class="btn btn-secondary"
              data-bs-dismiss="modal"
            >
              Close
            </button>
            <button
              type="button"
              class="btn btn-primary"
              onclick="changeColor()"
            >
              Change Color
            </button>
          </div>
        </div>
      </div>
    </div>
